//github.com/tony2265/map/releases/download/rpg_Knights_Expedition/V1.8.2_map.zip",res_link:"https://github.com/tony2265/resourcepack/releases/download/rpg_Knights_Expedition/v1.2.3.zip",creator_list:"組長／美宣：兔乃<br>建築：小瓜<br>技術：海歐<br>監製／隨隊：嗡嗡<br>建築協助：夜緋羽、閃光<br>企劃協助：悠梨、ＣＢ",story:"在受到上帝眷顧的都城「卡美洛」中，有一位英明的君主：亞瑟王。<br>他與麾下正直、忠誠的圓桌騎士團共同治理一片廣大的領土。<br>騎士受到亞瑟王的賞識，從容接下尋找聖杯的神聖使命。<br>於是，他義無反顧地投入一場未知的冒險。<br>他將證明自身的高潔與強大。等著他的，究竟是什麼呢？",yt:"https://www.youtube.com/embed/HFp1w6mBH-Q",fb_share:"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.dreamcity.studio%2Fmap%2Fknights_expedition&amp%3Bsrc=sdkpreparse",tw_share:"https://twitter.com/intent/tweet?text=騎士征途https://www.dreamcity.studio/map/knights_expedition",setting_list:{visual:["請於安裝材質包後，參照淺綠色進行設定。","畫面大小：自動。","語言設定：Unicode字型：關閉。"],music:["地圖內的自訂音效與BGM，可透過聲音設定進行調整，請安裝材質包後，參照材質說明。"],warning:["支援多人遊玩，建議1-4人遊玩","請務必安裝「指定材質包」","僅支援「官方伺服器」"]},fb_comment:"https://www.dreamcity.studio/map/knights_expedition",img_list:[{name:"都城－卡美洛",img:"https://www.dreamcity.studio/map/img/knights_expedition/1.jpg",des:"「國王與騎士的美好之地」<br>一座高聳潔白的城堡，被蓊鬱的參天大樹纏繞。青色的尖頂在藍天下交相輝映，充滿令人平靜的祥和氣息。"},{name:"都城－圓桌",img:"https://www.dreamcity.studio/map/img/knights_expedition/2.jpg",des:"「不可侵犯的決斷之處」<br>在氣勢恢弘的石造廳堂中，落下一道明亮的正義之光。國王與騎士總在偌大的圓桌上，共同商討繁重的國事。"},{name:"主大陸－漁村",img:"https://www.dreamcity.studio/map/img/knights_expedition/3.jpg",des:"「自然樸實的居所」<br>木造的房舍林立，依傍著一片蔚藍的海洋。許多居民深耕於此，但蜿蜒的小徑究竟通往何處？"},{name:"黑暗大陸－德魯伊聖所",img:"https://www.dreamcity.studio/map/img/knights_expedition/4.jpg",des:"「神祕的未知能量正潛伏於此」<br>透出昏黃亮光的黑色高塔正突兀地矗立在遠方。蟄伏其中的能量湧動，證明其蘊含了謀略的展望。"},{name:"系統－武器防具",img:"https://www.dreamcity.studio/map/img/knights_expedition/5.jpg",des:"騎士的劍是使命的脈動。<br>騎士的盾是守護的情操。<br>日鍛月煉、歷經征戰，方能締造出真正的實力。"},{name:"系統－料理烹飪",img:"https://www.dreamcity.studio/map/img/knights_expedition/6.jpg",des:"翻動記載了各式配方的食譜。<br>古老的鑄鍋飄出陣陣撲鼻的香氣。<br>令人食指大動的美味料理即將誕生。"}],ytb_list:[{name:"三尾木木犬",video:"https://www.youtube.com/watch?v=cBY9Vd9RLqY",img:"https://yt3.ggpht.com/ytc/AKedOLQ0Ep5CkA40A2asmQVg